import React, { Component } from "react";
import { Autocomplete, TextField, Button } from "@mui/material";
import { DataGrid } from "@mui/x-data-grid";
import "./QuanLyNguoiDung.css";
export default class QuanLyNguoiDung extends Component {
  handleClick = (value) => {
    console.log(value.row);
  };
  render() {
    const columns = [
      { field: "id", headerName: "ID", width: 70 , headerAlign: 'center'},
      { field: "firstName", headerName: "First name", width: 200 ,headerAlign: 'center'},
      { field: "lastName", headerName: "Last name", width: 200 ,headerAlign: 'center'},
      {
        field: "age",
        headerName: "Age",
        type: "number",
        width: 100,
        
      },
      {
        field: "fullName",
        headerName: "Full name",
        description: "This column has a value getter and is not sortable.",
        sortable: false,
        width: 100,
        valueGetter: (params) =>
          `${params.getValue(params.id, "firstName") || ""} ${
            params.getValue(params.id, "lastName") || ""
          }`,
      },
      {
        field: "button",
        headerName: "Action",
        width: 200,
        renderCell: (cellValues) => {
          return (
            <>
              <Button
                variant="contained"
                color="success"
                onClick={() => this.handleClick(cellValues)}
              >
                Sửa
              </Button>
              <Button
                variant="contained"
                color="warning"
                onClick={() => this.handleClick(cellValues)}
              >
                Xóa
              </Button>
            </>
          );
        },
      },
    ];

    const rows = [
      { id: 1, lastName: "Snow", firstName: "Jon", age: 35 },
      { id: 2, lastName: "Lannister", firstName: "Cersei", age: 42 },
      { id: 3, lastName: "Lannister", firstName: "Jaime", age: 45 },
      { id: 4, lastName: "Stark", firstName: "Arya", age: 16 },
      { id: 5, lastName: "Targaryen", firstName: "Daenerys", age: null },
      { id: 6, lastName: "Melisandre", firstName: null, age: 150 },
      { id: 7, lastName: "Clifford", firstName: "Ferrara", age: 44 },
      { id: 8, lastName: "Frances", firstName: "Rossini", age: 36 },
      { id: 9, lastName: "Roxie", firstName: "Harvey", age: 65 },
    ];
    return (
      <div className="container">
        <div className="form">
          <TextField
            className="input"
            id="outlined-basic"
            label="Outlined"
            variant="outlined"
            size="small"
          />
          <TextField
            className="input"
            id="filled-basic"
            label="Filled"
            variant="outlined"
            size="small"
          />
          <TextField
            className="input"
            id="standard-basic"
            label="Standard"
            variant="outlined"
            size="small"
          />
          <Button variant="outlined">Đăng Kí</Button>
        </div>
        <div className="data">
          <DataGrid rows={rows} columns={columns} pageSize={8} />
        </div>
      </div>
    );
  }
}
